    //Settings Support - BEGIN
    if (this.loadSettings()) {
      console.log('ImageViewer settings activated!');
    } else {
      CImageViewer.setSettings(this.getDefaultSettings());
      console.log('Failed to activate provided settings for an ImageViewer. Assuming defaults!');
    }

    //Settings Support - END

